import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import './NavBer.css'
import logo from '../images/logo.png'
import logo2 from '../images/logo2.png'




class NavBer1 extends Component {
    render() {
        return (
                 
   <div className="Navbar1">
  <Navbar bg="light" variant="light">

  <a href = "./home" > 
         <img src ={logo2} alt="logo"
          style={{
            width:"150px",
            height:"100px",
          }}/> 
      </a>

      <Nav className="NavLink">      
      <Nav.Link href="#home"style={{color:"white"}}>Home</Nav.Link>
      <Nav.Link href="#survey"style={{color:"white"}}>Survey</Nav.Link>
      <Nav.Link href="#liveStats"style={{color:"white"}}>COVIT-19 Live Stats</Nav.Link>
      <Nav.Link href="#about"style={{color:"white"}}>About Us</Nav.Link> 
    </Nav>   



  </Navbar>

  <div/>
 </div>
        );
    }
}

export default NavBer1;
